INSERT INTO `purposes` VALUES (1,'---\n- Omnis modi voluptas.\n- Quidem hic atque.\n'),(2,'---\n- Et vel harum vel inventore qui dolores repellendus.\n- Quod facilis veritatis ipsam et minima possimus.\n'),(3,'Ersatzstativ fr die Ausstellung.'),(4,'Ersatzstativ fr die Ausstellung.'),(5,'Ersatzstativ fr die Ausstellung.'),(6,'Earum dicta debitis vel harum nulla et.'),(7,'Neque alias aperiam est quis voluptatem accusantium dignissimos.'),(8,'Alias minima commodi nisi deserunt cupiditate.'),(9,'Quasi esse facere distinctio dolores et ut.'),(10,'Sequi dolor molestiae in.'),(11,'Aut esse iste dignissimos corporis et.'),(12,'Bentige ich fr die Aufnahmen meiner Abschlussarbeit.'),(13,'Sed et ut nesciunt deserunt fugiat laboriosam quaerat.'),(14,'Expedita in recusandae animi quisquam velit.'),(15,'Aperiam dolores tempora sint et mollitia non necessitatibus nulla.'),(16,'Rerum velit itaque commodi nihil et esse velit iure.'),(17,'Ersatzstativ fr die Ausstellung.'),(18,'Fr das zweite Austellungswochenende.'),(19,'Fr das dritte Austellungswochenende.'),(20,'Fr die Abschlussarbeit.'),(21,'Ersatzstativ fr die Ausstellung.'),(22,'Bestellung mit Software'),(23,'Bestellung mit Gegenstand ohne Ort'),(24,'Um meine Abschlussarbeit zu fotografieren.'),(25,'Labore suscipit ut facilis ut.'),(26,'Um meine Abschlussarbeit zu fotografieren.'),(27,'Um meine Abschlussarbeit zu fotografieren.'),(28,'Iure tempore distinctio aliquid necessitatibus excepturi vero sed consectetur.'),(29,'Paketausgabe'),(30,'Fr meinen aktuellen Kurs.'),(31,'Ersatzstativ fr die Ausstellung.'),(32,'Um meine Abschlussarbeit zu fotografieren.'),(33,'Ersatzstativ fr die Ausstellung.'),(34,'Ersatzstativ fr die Ausstellung.'),(35,'Ersatzstativ fr die Ausstellung.'),(36,'Ersatzstativ fr die Ausstellung.'),(37,'Ersatzstativ fr die Ausstellung.'),(38,'Ersatzstativ fr die Ausstellung.'),(39,'Ersatzstativ fr die Ausstellung.'),(40,'Ersatzstativ fr die Ausstellung.'),(41,'Ersatzstativ fr die Ausstellung.'),(42,'Fotoshooting (Ku